import React, { useState, useEffect } from "react";
import RecipeService from "../services/recipe.service";
import "./style.css";

const MyRecipePage = () => {
  return (
    <main>
      <div className="container py-4">
        <div className="container-fluid py-5">
          <MyRecipe/>
          {/* <LikedRecipe/> */}
        </div>
      </div>
    </main>
  );
};

const Recipe = ({recipe}) => {
  return(
    <div>
      <h5> {recipe.name} </h5>
      <p> {recipe.desc} </p>
    </div>
  );
};

const MyRecipe = () => {
  const [recipes, setRecipes] = useState([]);

  useEffect(() => {
    RecipeService.getMyRecipe()
    .then(({data}) => {
      setRecipes(data);
    })
    .catch((err) => {
      console.log(err)
    });
  }, [])

  return(
    <div>
      <h3>My Recipes</h3>
      {recipes.map((recipe, idx) => 
        <Recipe key={idx} recipe={recipe}/>
      )}
    </div>
  );
};

const LikedRecipe = () => {
  return(
    <div>
      <h3> Liked Recipes </h3>
    </div>
  )
}

export default MyRecipePage;
